import React from 'react';
import '../styles/temperature.css';
import fire from "../resources/fire.svg";
import snowflake from "../resources/snowflake.svg";

function Temperature() {
  return (
    <div className='temperature'>
    <div className='temperature-title'>Temperature</div>
    <div className='temperature-content'>
    <div className='temperature-present'>21</div>
    <div className='temperature-no'>
        <div className='temperature-high'><img className='temperature-fire' src = {fire} alt = "img"/>
        26</div>
        <div className='temperature-low'>
        <img className='temperature-snowflake' src = {snowflake} alt = ""/>
        18 &#8451;</div>
    </div>
    </div>
    </div>
  )
}

export default Temperature;
